custom_css:
.container { width: 950px; margin: 0 auto; }
.frm { border: 1px solid #ccc; padding: 10px; }
.frm th, .frm td { padding: 5px; }
.label { font-weight: bold; }
.box { border: 1px solid #ccc; margin-bottom: 10px; }
.list { width: 100%; border-collapse: collapse; }
.list th, .list td { border: 1px solid #ddd; padding: 5px; }
.list th { background: #f4f4f4; }
.hovered tr:hover { background: #f9f9f9; }
.sticky { position: sticky; top: 0; }
.ra { text-align: right; }
.pad1 { padding: 5px; }
.clear { clear: both; }
.noselect { user-select: none; }
.green { color: #319965; }
.red { color: #ff0302; }
